import { Text, View, StyleSheet } from 'react-native';
function list({ data }) {
    return (
        data.map((dataPoint) => (
            <View style={styles.listItem} key={dataPoint} >
                <Text style={styles.itemText}>{dataPoint} </Text>
            </View>
        ))
    );
}
export default list;
const styles = StyleSheet.create({
    listItem: {
        paddingHorizontal: 8,
        paddingVertical: 4,
        borderRadius: 6,
        marginVertical: 4,
        marginHorizontal: 12,
        backgroundColor: '#e2b497',
    },
    itemText:{
        color:'#351401',
        textAlign:'center',

    }
})
